      project.tasks.push(task.id);
      assigned_user.tasks.push(task.id);
      if (!TasksByMonth[date.getFullYear() + "_" + date.getMonth()]) {
        TasksByMonth[date.getFullYear() + "_" + date.getMonth()] = [];
